import React from 'react';
import Nav from './component/Nav/Nav';
import { Route, Routes } from 'react-router-dom';
import Landing from './component/Landing/Landing';

const WebApp = () => {
    return (
        <div>
            <Nav />
            <Routes>
                <Route path='/' element = {Landing}/>
            </Routes>
        </div>
    );
};

export default WebApp;
